  'Nova Estrutura de Zoneamento: substituição das zonas de uso anteriores por 16 Zonas de Ordenamento Territorial (ZOTs) com diretrizes e parâmetros mais claros.

📐 2. Parâmetros Urbanísticos:

Alturas máximas e coeficientes de aproveitamento definidos por ZOT, com estímulo ao adensamento de áreas com maior disponibilidade de infraestrutura e acesso a equipamentos públicos e serviços urbanos.

Criação da taxa de permeabilidade, possibilitante o aumento da permeabilidade do solo e adaptando o território as mudanças climáticas.

Uso do solo mais flexível: incentivo à mistura de usos, especialmente em áreas com maior infraestrutura.

🚇 3. Estratégia de Adensamento:

Definição de Áreas Estratégicas para Adensamento com base na infraestrutura instalada (transporte, saneamento, equipamentos).

Integração entre forma urbana e função social da cidade, com foco em ampliar acesso à moradia e oportunidades.

🛠️ 4. Instrumentos de Planejamento e Gestão:',
