  '🟩 Resposta:  O Plano Diretor Urbano Sustentável de Porto Alegre trata as áreas de risco com enfoque na resiliência urbana e adaptação às mudanças climáticas, integrando estratégias de prevenção, recuperação e mitigação dos riscos ambientais, especialmente em relação a enchentes, deslizamentos e ocupações em áreas suscetíveis a desastres naturais.

Principais pontos sobre áreas de risco:

O Plano Diretor define como objetivo a adaptação da cidade aos efeitos das mudanças climáticas, incluindo a implantação de sistemas de monitoramento e alerta de eventos extremos, o fortalecimento da infraestrutura urbana adaptativa e a incorporação da gestão de riscos climáticos ao planejamento urbano e aos instrumentos de regulação territorial.

Prevê a elaboração de um plano de ação para a recuperação das áreas de risco e para a mitigação de riscos nas áreas passíveis de ocupação, de forma integrada com as políticas de habitação.',
