  'Define as Áreas de Risco e Vulnerabilidade Ambiental (ARVA) como zonas suscetíveis a desastres naturais, como enchentes e deslizamentos, ou a impactos antrópicos, como poluição. Nessas áreas, são estabelecidas restrições de ocupação e necessidade de intervenções para mitigação dos riscos.

O Plano também aponta a necessidade de estabelecer incentivos e normas para aumentar a resiliência das edificações e espaços urbanos, como o uso de infraestruturas verdes, áreas permeáveis e corredores ecológicos.

A Lei de Uso e Ocupação do Solo (LUOS), que regulamenta o Plano Diretor, veda o parcelamento e a edificação em terrenos alagadiços ou sujeitos a inundações, em áreas com declividade acentuada (igual ou superior a 30%) ou em terrenos cuja condição geológica não seja compatível com a edificação, salvo se forem atendidas exigências técnicas específicas. Também há restrições para edificações em áreas de preservação permanente, salvo exceções previstas em lei.',
