  'Exige-se, em áreas estratégicas para drenagem urbana, a construção de reservatórios de retenção de águas pluviais, dependendo do tipo de edificação.

Em resumo:

O Plano Diretor propõe um tratamento preventivo e regulatório das áreas de risco, priorizando a segurança, a resiliência e a adaptação climática. As intervenções são pautadas por critérios técnicos, com restrições ao uso e ocupação do solo em áreas vulneráveis e integração das ações urbanísticas às políticas ambientais e habitacionais. Esses parâmetros fazem parte da proposta de revisão da Lei de Uso e Ocupação do Solo de Porto Alegre.

🟨 Pergunta:

Como é feito o zoneamento na nova LUOS?

🟩 Resposta:  O território foi dividido em 16 ZOTs, com base em características morfológicas, ambientais e funcionais. Cada ZOT possui parâmetros próprios:

ZOTs 1 a 3: áreas predominantemente residenciais com baixa transformação;

ZOTs 4 a 7: áreas com maior potencial de adensamento e transformação urbana;',
