  'ZOTs 8 a 13: áreas estratégicas, com maior verticalização e articulação a planos e projetos estruturantes;

ZOTs 14 a 16: áreas de transição e proteção ambiental, com parâmetros mais restritivos e foco em usos compatíveis com a preservação.

🟨 Pergunta:O que é o Plano Diretor Urbano Sustentável (PDUS)?

🟩 Resposta:  O PDUS é a lei que orienta o desenvolvimento urbano de Porto Alegre. Ele define as estratégias para o uso e a ocupação do solo, organização do território, infraestrutura, mobilidade, proteção ambiental, habitação e desenvolvimento econômico. A proposta atual está sendo revisada com foco em sustentabilidade, qualificação dos espaços públicos e adaptação às mudanças climáticas.

🟨 Pergunta: O que pode ser construído no bairro Três Figueiras?

🟩 Resposta:  

No bairro Três Figueiras, é possível construir de acordo com as seguintes Zonas de Ordenamento Territorial (ZOTs). Abaixo estão os parâmetros construtivos relevantes:',
