1. **ZOT 08.3 - C**: Permite uma altura máxima de 90 metros, com coeficiente de aproveitamento básico de 3.6 e máximo de 7.5.

2. **ZOT 04**: Permite uma altura máxima de 18 metros, com coeficiente de aproveitamento básico de 2.0 e máximo de 4.0.

 3. **ZOT 07**: Permite uma altura máxima de 60 metros, com coeficiente de aproveitamento básico de 3.6 e máximo de 6.5.

