  '🟩 Resposta:  O novo Plano Diretor trata a habitação de interesse social como eixo estruturante da política urbana, com foco na redução do custo da moradia e na garantia do acesso de todos à cidade. Esse Objetivo Estratégico reconhece que o afastamento da população de baixa renda dos territórios bem estruturados é um dos principais vetores de desigualdade urbana em Porto Alegre, propondo ampliar a produção de moradia em áreas com infraestrutura, serviços e oferta de oportunidades, especialmente ao longo dos eixos de transporte coletivo e nas centralidades.',
