  'Para viabilizar essa diretriz, a LUOS estabelece parâmetros específicos de parcelamento e uso do solo voltados à demanda habitacional prioritária, além de prever incentivos urbanísticos como a Outorga Onerosa do Direito de Construir, com fator de planejamento diferenciado — incluindo a isenção do valor da outorga para habitação de interesse social — e a destinação de recursos ao Fundo Municipal de Habitação. De forma complementar, o plano define as Áreas de Requalificação Urbana (ARU) como territórios com carências de infraestrutura e baixa integração à malha urbana, priorizando-os para intervenções públicas e privadas voltadas à urbanização, regularização e qualificação habitacional.

🟨 Pergunta:

Como o Plano Diretor aborda as ZEIS (Zonas Especiais de Interesse Social)?',
